main: nop

# cenarios
addi $a1 $0 0 # 1 mapa de bits. 0 funcoes
beq $a1 $0 retangulos

addi $a0 $0 1 # numero cenrio a ser carregado

loadscream:
sll $a0 $a0 2 # byte de memoria
addi $a1 $0 8192 # tamanho da tela
mul $a0 $a0 $a1 # offset de memoria ate o cenario
addi $a0 $a0 0x10010000 # endereco inicial do cenario
lui $a2 0x1001 # inicio da escrita

loadpix:
beq $a1 $0 fimloadpix
lw $a3 0($a0) # copia cenario
sw $a3 0($a2) # escreve cenario
addi $a0 $a0 4 # prx pixel a ser copiado
addi $a2 $a2 4 # prx pixel a ser escrito
addi $a1 $a1 -1 # variavel de iteracao
j loadpix
fimloadpix:

j end

j retangulos

# circulos

circulos:

addi $t0 $0 7 # raio
add $t1 $0 $t0 
addi $t2 $0 3 # pi
addi $a0 $0 0x10010000 # inicio
addi $t4 $0 67 # x
sll $t4 $t4 2
addi $t5 $0 9 # y
sll $t5 $t5 9
add $a0 $a0 $t4
add $a0 $a0 $t5 
add $t6 $0 $a0 # inicio
addi $a1 $0 0xffff00 # cor

jal circ

j end

circ:
sw $ra 0($sp)
addi $sp $sp -4

q4: beq $t1 $0 fimq4

sub $t3 $t0 $t1 # A = raio - linha
sll $t3 $t3 1 # B = A * 2
div $t3 $t2 # C = B MOD 3
mflo $t3
mul $t3 $t3 $t3 # D = C**2
srl $t3 $t3 2 # E = D MOD 4

sub $a2 $t0 $t3 # tamanho

jal linhap

addi $t6 $t6 512
sub $a2 $t0 $t3
sll $a2 $a2 2
sub $t6 $t6 $a2
addi $t1 $t1 -1
j q4

fimq4: 
add $t1 $0 $t0
add $t6 $0 $a0 # inicio
q1: beq $t1 $0 fimq1

sub $t3 $t0 $t1 # A = raio - linha
sll $t3 $t3 1 # B = A * 2
div $t3 $t2 # C = B MOD 3
mflo $t3
mul $t3 $t3 $t3 # D = C**2
srl $t3 $t3 2 # E = D MOD 4

sub $a2 $t0 $t3 # tamanho

jal linhap

addi $t6 $t6 -512
sub $a2 $t0 $t3
sll $a2 $a2 2
sub $t6 $t6 $a2
addi $t1 $t1 -1
j q1

fimq1:
add $t1 $0 $t0
add $t6 $0 $a0 # inicio

q2: beq $t1 $0 fimq2

sub $t3 $t0 $t1 # A = raio - linha
sll $t3 $t3 1 # B = A * 2
div $t3 $t2 # C = B MOD 3
mflo $t3
mul $t3 $t3 $t3 # D = C**2
srl $t3 $t3 2 # E = D MOD 4

sub $a2 $t0 $t3 # tamanho

jal linhan

addi $t6 $t6 -512
sub $a2 $t0 $t3
sll $a2 $a2 2
add $t6 $t6 $a2
addi $t1 $t1 -1
j q2

fimq2:
add $t1 $0 $t0
add $t6 $0 $a0 # inicio

q3: beq $t1 $0 fimq3

sub $t3 $t0 $t1 # A = raio - linha
sll $t3 $t3 1 # B = A * 2
div $t3 $t2 # C = B MOD 3
mflo $t3
mul $t3 $t3 $t3 # D = C**2
srl $t3 $t3 2 # E = D MOD 4

sub $a2 $t0 $t3 # tamanho

jal linhan

addi $t6 $t6 512
sub $a2 $t0 $t3
sll $a2 $a2 2
add $t6 $t6 $a2
addi $t1 $t1 -1
j q3

fimq3:
addi $sp $sp 4
lw $ra 0($sp)
jr $ra

linhap:
sw $ra 0($sp)
addi $sp $sp -4
lp:
beq $a2 $0 fimlp
sw $a1 0($t6)
