addi $a2 $a2 -1
j lp
fimlp: 
addi $sp $sp 4
lw $ra 0($sp)
jr $ra

linhan:
sw $ra 0($sp)
addi $sp $sp -4
ln:
beq $a2 $0 fimln
sw $a1 0($t6)
addi $t6 $t6 -4
